import React from "react";
import { Box, Container } from "@mui/material";
import AudioPlayer from "./AudioPlayer"; // Import the AudioPlayer component

function Home() {
  // Sample audio file URLs
  const audioFiles = [
    { url: "https://example.com/audio1.mp3", name: "Audio 1" },
    { url: "https://example.com/audio2.mp3", name: "Audio 2" },
    { url: "https://example.com/audio3.mp3", name: "Audio 3" },
  ];

  return (
    <Box sx={{ position: "relative", minHeight: "100vh", overflow: "hidden" }}>
      <Container sx={{ padding: "0", zIndex: 1 }}>
        <Box
          sx={{
            marginTop: "50px",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            flexDirection: "column", // Align content vertically
          }}
        >
          {/* Your content here */}
          <h1>Welcome To SuperSonics</h1>
        </Box>
      </Container>

      {/* Position the AudioPlayer fixed at the bottom */}
      <Box
        sx={{
          position: "fixed",
          bottom: 0,
          left: 0,
          right: 0,
          zIndex: 2, // Ensure it's above other content
        }}
      >
        <AudioPlayer audioFiles={audioFiles} />
      </Box>
    </Box>
  );
}

export default Home;
